import Header from "./Header";
import Head from "./Head";

const layoutStyle = {
  margin: 20
};

const Layout = props => {
  return (
    <>
      <Head></Head>
      <div style={layoutStyle}>
        <Header />
        {props.children}
      </div>
    </>
  );
};

export default Layout;
